import logo from './logo.svg';
import './App.css';
import {Route,Link,BrowserRouter as Router,Switch} from "react-router-dom";
import Login from "./Components/Login";
import Home from "./Components/Home";
import Navbar from './Components/Navbar/Navbar';
import AddUser from "./Components/Admin/UserManagment/AddUser";
import ListUsers from './Components/Admin/UserManagment/ListUsers';
import Sidebar from './Components/Navbar/Sidebar';
function App() {
  return (
    <div className="App app-background" style={{minHeight:window.innerHeight,width:window.innerWidth}}>

    <Router>
    <Navbar />
      <Switch>
        <Route path="/login" component={Login}></Route>
        <Route path="/admin/adduser" component={AddUser}></Route>
        <Route path="/admin/listUsers" component={ListUsers}></Route>
        <Route path="/" component={Home}></Route>


      </Switch>
    </Router>
    </div>
  );
}

export default App;
